        "vaeua-gui-eua.sas.van.Insights.outliers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">The <span class\\="xis-windowItem">Outliers</span>                     insight identifies data items in your report that might be affected by outlier                     values. </p><p class\\="xis-paragraph">To view an analysis of the outliers                     for a measure, click <span data-icon-name\\="information" alt\\="the Information icon" aria-label\\="the Information icon"></span> beside the measure, and then click <span class\\="xis-windowItem">View outlier                         analysis</span> in the pop-up window.</p><p class\\="xis-paragraph">To view the effects of outliers on the                     objects in your report, click <span class\\="xis-windowItem">Analyze Objects for                         Impact</span>. When the analysis is complete, click                         <span class\\="xis-windowItem">Details</span> beside an object name to see a detailed                     analysis of the outliers in that object.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Note\\:</span>The <span class\\="xis-windowItem">Outliers</span>                     insight identifies all of the outliers in your data sources, even if your report                     objects exclude the values by using filters or ranks.</div></section>',
