        "vaeua-gui-eua.sas.van.Options.alternativeText.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies a meaningful, accessible                     name for an object. The text is announced by a screen reader when a user                     navigates to the object.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Includes direct connections between                     each input neuron and each target neuron in the network.</p></section>',
        "vaeua-gui-eua.properties.sankey.compress.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.Properties.factmac.learnStep.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">The <span class\\="xis-windowItem">Tick value                         display</span> option specifies the method that is used to fit tick                     mark values on the X axis. You can select either <span class\\="xis-windowItem">Automatically                         reduce overlap</span> or <span class\\="xis-windowItem">Fixed                     orientation</span>.</p><div class\\="xis-paragraph">The <span class\\="xis-windowItem">Automatically reduce                         overlap</span> option is applied only when tick values overlap. You                     can specify the following\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Stagger, truncate, drop</span></td><td>shifts the values alternately up and down, clips                                 characters from the tick values, and then drops tick                                 values.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rotate 45°</span></td><td>rotates all tick values 45°                                 diagonally.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Stagger</span></td><td>shifts the tick values alternately up and                                 down.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Stagger, truncate</span></td><td>shifts the tick values alternately up and down, and                                 then clips characters from the tick values.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Truncate</span></td><td>clips characters from the tick                                 values.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Truncate, rotate 45°</span></td><td>clips characters from the tick values and rotates all                                 tick values 45° diagonally.</td></tr></table></div>                 </div><div class\\="xis-paragraph">The <span class\\="xis-windowItem">Fixed                         orientation</span> option is always applied and sets the orientation                     of the values. You can specify the following\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Horizontal</span></td><td>displays tick values horizontally.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rotate 45°</span></td><td>rotates all tick values 45°                                 diagonally.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rotate 45°, drop</span></td><td>rotates all tick values 45° diagonally and then drops                                 tick values.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Performs fast backward variable                     selection to determine what variables are considered for model creation. Only                     variables with <span class\\="xis-userSuppliedValue">p</span>-values below the                     specified significance level are considered.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Your report takes a long time to load                     the first page. If SAS Visual                         Analytics identifies performance issues other than slow                     loading times, fix those issues first. If no other performance issues are                     identified, contact your administrator to determine whether other factors are                     impacting your report. For example, a slow connection can cause a report to load                     slowly.</p><p class\\="xis-paragraph">Low priority\\: takes &gt;\\= 5                     seconds</p><p class\\="xis-paragraph">Medium priority\\: takes &gt;\\= 10                     seconds</p><p class\\="xis-paragraph">High priority\\: takes &gt;\\= 25                     seconds</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies the activation function that                     is used to create the output layer when using a normal distribution to model the                     response. The exponential activation function is used with a gamma or Poisson                     distribution. </p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Include related data items (role                     assignments, filters, and so on) with the saved object.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.heatmap.binCountNotApplicableToNonMeasures.help.aria.txt": "Help. More information about this option ",
