        "vaeua-gui-eua.usingTimeZones.help.tip.txt": "Which time zone can I select for multiple dates?",
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies whether text links to this                     page are hidden for users who cannot view it. </p><p class\\="xis-paragraph">If you do not enable this option, then                     users who do not have access see a notification message when they attempt to                     follow the text link.</p></section>',
        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.overviewAxisOptions.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">The <span class\\="xis-windowItem">Overview                         axis</span> displays the full data range in an additional condensed                     plot beneath the primary plot. The condensed plot lets you have interactive                     control of the range that is displayed in the primary plot.</p></section>',
        "vaeua-gui-eua.react.va.geo.search.exitSelectionMode.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Determines whether a stop list is                     used. A stop list is a simple collection of low-information or extraneous words                     that you want to remove from the text. These words must be saved in a SAS data                     set that is loaded on the CAS server.</p></section>',
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.tip.txt": "More information about this option ",
