        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uses the default number of predictors                     to try for each split. The default is the total number of predictors. Otherwise,                     specify the number of predictors to try for each split.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uses the default penalty value. The                     default is 1.0.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageCount.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">If the number of observations that                     have missing values for a candidate predictor is greater than or equal to the                     minimum value specified, then the missing values are treated as a separate value                     when searching for split candidates.</p></section>',
        "vaeua-gui-eua.barSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">The <span class\\="xis-windowItem">Spacing</span>                     option specifies the space between bars.</p><p class\\="xis-paragraph">For grouped bars that are clustered,                     the space appears between the clusters. There are no spaces between the                     individual bars within a cluster.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.aria.txt": "Help. More information about this option ",
