        "vaeua-gui-eua.sas.van.Options.CrosstabRestartNumbers.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomSortEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Reduce the number of values in a                     custom sorts to eliminate the following issue. For example, to eliminate low                     priority issues, reduce the number of selected values in a custom sort to 25 or                     fewer.</p><p class\\="xis-paragraph">Low priority\\: contains &gt; 25                     sorts</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionCriterion.help.tip.txt": "More information about this option ",
