        "vaeua-gui-eua.Properties.generalizedAdditive.fConvValue.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.Properties.predAuto.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Extends the analysis to include                     observations with missing values. For category factors, missing values are                     treated as their own level when the analysis is performed. For measure factors,                     missing values are used in the calculation of the worth of a splitting rule. A                     splitting rule is produced that assigns the missing values to the branch that                     maximizes the worth of the split.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.auto_stop_method.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies a criterion to leverage                     validation data to terminate learning at a locally optimal                     iteration.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.learningRate.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies a method to treat missing                     values for predictors. For a category response, this also treats missing values                     as a valid response level.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.Properties.svm.customToleranceValue.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.sas.van.Options.CrosstabRestartNumbers.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Controls how the cells are weighted in                     the term-by-document matrix. The cell weight is a function that is applied to                     every entry in the term-by-document matrix to moderate the effect of a term that                     is repeated within a document.</p></section>',
        "vaeua-gui-eua.Properties.generalizedAdditive.maxDf1d.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.ridge.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.Properties.models.usePartition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Partitions data into a training data                     set and a validation data set. Models that are built with training data are                     verified with the validation data to prevent overfitting.</p></section>',
        "vaeua-gui-eua.Properties.assessment.showAllPlots.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.nbins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies the number of bins to use                     for each measure variable when generating the parallel coordinate polyline                     plots. Detailed binning can result in slow graph performance.</p></section>',
        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uses the default number of bins for                     calculating the lift statistic. The default is 20.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.glm.linkFunction.label.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.sas.van.control.initialValue.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.ReportDistribution.ChooseMicrosoftTeamsChannel.Available.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.eventLevel.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies the value of the response                     that represents the event for calculating various statistics, including ROC and                     lift.</p></section>',
        "vaeua-gui-eua.Properties.assessment.numberOfBinsCategory.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies the number of bins to use                     for calculating the lift statistics. </p></section>',
        "vaeua-gui-eua.Properties.bayesNet.maxParents.help.tip.txt": "More information about this option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.vote.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies how predicted probabilities                     are calculated for the levels of the response. </p></section>',
        "vaeua-gui-eua.ReportDistribution.ChooseMicrosoftTeamsChannel.Available.help.tip.txt": "More information about this option ",
