        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifies the initial maximum value                     (upper bound) for the control. The initial value is selected the first time a                     user opens the report, or when a user selects <span class\\="xis-windowItem">Restore default report                         state</span>. </p><div class\\="xis-paragraph">Enter a value in the text field, or                     specify one of the following\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatic</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifies that your                                     selection is saved as the initial value when you save the                                     report. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Maximum Value</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifies that the                                     greatest value in the control is the initial value.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifies that the                                     value of the parameter that you select is the initial value for                                     the control.</p><p class\\="xis-paraSimple">You can select a                                     parameter only if a parameter with the appropriate data type                                     already exists.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Help. More information about this option ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Specifies how traffic is used to                     calculate travel time for the graphic feature. Select one of the following                         options\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">No</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Specifies that the                                     travel-time calculation uses a weighted average of historical                                     traffic data for all times of day and for all days of the                                     week.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Current traffic</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Specifies that the                                     travel-time calculation uses current traffic conditions. This                                     traffic data can be updated by clicking <span data-icon-name\\="refresh" alt\\="the Update traffic data icon" aria-label\\="the Update traffic data icon"></span>. When a user views the report, the traffic is                                     not updated automatically. The user must update the traffic data                                     to reflect the latest traffic conditions.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Typical traffic</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> specifies that the                                     travel-time calculation uses typical traffic for the specified                                     time and day of the week. The typical traffic conditions are                                     based on recent historical data.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Note\\:</span> The time that you specify                                     is the local time for the location on the map.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Note\\:</span>Retrieving travel-time data consumes Esri                     Premium Services credits.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Note\\:</span>If no traffic data is available for the                     area that contains the travel-time calculation, then posted speed limits are                     used to calculate the travel time.</div></section>',
