        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Select the variable to use to split                     the node. Variables are sorted by logworth, which measures how well that                     variable divides the data. Logworth is the negative log of the p-value from the                     chi-square test.</p></section>',
